(45, 0, 'Etablissement', ' Un établissement peut regrouper différents bâtiments', '', 45, '2009-07-19 18:37:32', 'oui', 0, 'publie', '2009-07-19 16:46:53', 'fr', 'non', 'oui', NULL, '', 'publie', '2009-07-19 16:46:53'),
(46, 45, 'Bâtiment', 'Un bâtiment est un élément bâti appartenant à un établissement', '', 45, '2009-07-19 18:37:31', 'oui', 0, 'publie', '2009-07-19 16:46:53', 'fr', 'non', 'oui', NULL, '', 'publie', '2009-07-19 16:46:53'),
(47, 46, 'Niveau', 'Un niveau correspond à un étage ou un sous-sol d''un bâtiment. Comme un bâtiment, un niveau peut être ouvert au public, exclusivement réservé au personnel ou mixte.', '', 45, '2009-07-19 18:37:31', 'oui', 0, 'publie', '2009-07-19 16:46:53', 'fr', 'non', 'oui', NULL, '', 'publie', '2009-07-19 16:46:53'),
(48, 47, 'Objets intérieurs (niveau)', 'Les objets correspondent à des éléments qui sont individualisés du point de vue de la réglementation. Il s''agit par exemple des escaliers, des ascenseurs ou encore des portes', '', 45, '2009-07-19 18:37:30', 'oui', 0, 'publie', '2009-07-19 16:24:21', 'fr', 'non', 'oui', NULL, '', 'publie', '2009-07-19 16:24:21'),
(49, 47, 'Espaces intérieurs', 'Les espaces correspondent aux éléments surfaciques de base de l''état des lieux. Les espaces peuvent être spécifiques (Accueil, Sanitaires...) ou non ; dans ce dernier cas il faut tenir compte de l''ensemble des critères non-spécifiques.', '', 45, '2009-07-19 18:37:30', 'oui', 0, 'publie', '2009-07-19 16:46:53', 'fr', 'non', 'oui', NULL, '', 'publie', '2009-07-19 16:46:53'),
