cr_asc_cab_18</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-15 09:52:20</date><maj>2008-05-15 09:52:20</maj><valeur>Il y a une boucle &#xE0; induction magn&#xE9;tique pour la diffusion &#xE0; tous de l''information d''urgence</valeur><valeur>cr_asc_cab_19</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-15 09:52:20</date><maj>2008-05-15 09:52:20</maj><valeur>L''ascenseur est en acc&#xE8;s libre (sans clef ou intervenant ext&#xE9;rieur)</valeur><valeur>cr_asc_cab_20</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-15 09:52:20</date><maj>2008-05-15 09:52:20</maj><valeur>Les signaux sonores sont entre 35 et 65 dB</valeur><valeur>cr_asc_cab_21</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-15 09:52:20</date><maj>2008-05-15 09:52:20</maj><valeur>L''&#xE9;clairage est sup&#xE9;rieur &#xE0; 100 lux</valeur><valeur>cr_asc_cab_22</valeur><valeur>124</valeur></donnee></donnees></article><article id="1794">cr_asc_cab_01 15/05/08 - 09:52:57<date>2008-05-15 09:52:57</date><maj>2008-05-15 09:52:57</maj><auteur>6</auteur><donnees><grille>60</grille><champs><champ>ligne_2</champ><champ>ligne_4</champ><champ>mot_2</champ><champ>texte_1</champ><champ>texte_2</champ><champ>ligne_3</champ><champ>ligne_1</champ><champ>mot_1</champ></champs><donnee><date>2008-05-15 09:52:57</date><maj>2008-05-15 09:52:57</maj><valeur/><valeur/><valeur/><valeur/><valeur/><valeur>cr_asc_cab_01</valeur><valeur>Pb 01</valeur><valeur>1</valeur></donnee></donnees></article></rubrique></rubrique></rubrique></rubrique></rubrique></documents>\n', '2008-05-15 09:54:46'),
