aleur><valeur>2</valeur></donnee><donnee><date>2008-05-15 09:52:19</date><maj>2008-05-15 09:52:19</maj><valeur>Les commandes int&#xE9;rieures sont &#xE0; une hauteur comprise entre 90 et 110 cm</valeur><valeur>cr_asc_cab_02</valeur><valeur>141</valeur></donnee><donnee><date>2008-05-15 09:52:19</date><maj>2008-05-15 09:52:19</maj><valeur>Les commandes int&#xE9;rieures sont &#xE0; plus de 40 cm d''un angle rentrant ou d''un obstacle</valeur><valeur>cr_asc_cab_03</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-15 09:52:19</date><maj>2008-05-15 09:52:19</maj><valeur>Les commandes sont rep&#xE9;rables (visuellement et tactilement)</valeur><valeur>cr_asc_cab_04</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-15 09:52:19</date><maj>2008-05-15 09:52:19</maj><valeur>Le bouton indiquant le niveau de sortie est tactilement (en saillie) et visuellement (vert) contrast&#xE9; des autres commandes</valeur><valeur>cr_asc_cab_05</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-15 09:52:19</date><maj>2008-05-15 09:52:19</maj><valeur>Les commandes int&#xE9;rieures poss&#xE8;dent un t&#xE9;moin d''activation visuel et sonore</valeur><valeur>cr_asc_cab_06</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-15 09:52:19</date><maj>2008-05-15 09:52:19</maj><valeur>Les boutons de commandes sont contrast&#xE9;s (visuellement et tactilement) par rapport &#xE0; leur support</valeur><valeur>cr_asc_cab_07</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-15 09:52:19</date><maj>2008-05-15 09:52:19</maj><valeur>La cabine mesure au minimum 100 cm de largeur</valeur><valeur>cr_asc_cab_08</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-15 09:52:19</date><maj>2008-05-15 09:52:19</maj><valeur>La cabine mesure au minimum 125 cm de profondeur devant chaque porte</valeur><valeur>cr_asc_cab_09</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-15 09:52:19</date><maj>2008-05-15 09:52:19</maj><valeur>Pr&#xE9;sence d''une main courante sur une