12:46:47</maj><auteur>6</auteur><donnees><grille>65</grille><champs><champ>ligne_2</champ><champ>ligne_3</champ><champ>select_1</champ><champ>ligne_1</champ><champ>select_2</champ></champs><donnee><date>2008-05-20 12:46:39</date><maj>2008-05-20 12:46:39</maj><valeur/><valeur/><valeur/><valeur>Cabine 2</valeur><valeur>select_2_1</valeur></donnee></donnees></article><rubrique id="4591" idParent="4590">Cabine ascenseur 20/05/08 - 12:46:47<motclef>125</motclef><article id="1823" idRub="4591">Cabine ascenseur 20/05/08 - 12:46:47<date>2008-05-20 12:46:47</date><maj>2008-05-20 12:46:47</maj><auteur>6</auteur><donnees><grille>59</grille><champs><champ>ligne_2</champ><champ>ligne_1</champ><champ>mot_1</champ></champs><donnee><date>2008-05-20 12:46:47</date><maj>2008-05-20 12:46:47</maj><valeur>Les commandes int&#xE9;rieures sont situ&#xE9;es sur le c&#xF4;t&#xE9; de la cabine ; &#xE0; droite (ouverture centrale) ou du c&#xF4;t&#xE9; de fermeture de la porte (si l''ascenseur est inf&#xE9;rieur &#xE0; 200 x 140 cm)</valeur><valeur>cr_asc_cab_01</valeur><valeur>141</valeur></donnee><donnee><date>2008-05-20 12:46:47</date><maj>2008-05-20 12:46:47</maj><valeur>Les commandes int&#xE9;rieures sont &#xE0; une hauteur comprise entre 90 et 110 cm</valeur><valeur>cr_asc_cab_02</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-20 12:46:47</date><maj>2008-05-20 12:46:47</maj><valeur>Les commandes int&#xE9;rieures sont &#xE0; plus de 40 cm d''un angle rentrant ou d''un obstacle</valeur><valeur>cr_asc_cab_03</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-20 12:46:47</date><maj>2008-05-20 12:46:47</maj><valeur>Les commandes sont rep&#xE9;rables (visuellement et tactilement)</valeur><valeur>cr_asc_cab_04</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-20 12:46:47</date><maj>2008-05-20 12:46:47</maj><valeur>Le bouton indiquant le niveau de sortie est tactilement (en saillie) et visuellement (vert) contrast&#xE9; des autres commandes</valeur><valeur>cr_asc_cab_05</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-20 12:46:47</date><maj>2008-05-20 12:46:47</maj><valeur>Les commandes int&#xE9;rieures poss&#xE8;dent un t&#xE9;moin d''activation visuel et sonore</valeur><valeur>cr_asc_cab_06</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-20 12:46:47</date><maj>2008-05-20 12:46:47</maj><valeur>Les boutons de commandes sont contrast&#xE9;s (visuellement et tactilement) par rapport &#xE0; leur support</valeur><valeur>cr_asc_cab_07</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-20 12:46:47</date><maj>2008-05-20 12:46:47</maj><valeur>La cabine mesure au minimum 100 cm de largeur</valeur><valeur>cr_asc_cab_08</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-20 12:46:47</date><maj>2008-05-20 12:46:47</maj><valeur>La cabine mesure au minimum 125 cm de profondeur devant chaque porte</valeur><valeur>cr_asc_cab_09</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-20 12:46:47</date><maj>2008-05-20 12:46:47</maj><valeur>Pr&#xE9;sence d''une main courante sur une des parois</valeur><valeur>cr_asc_cab_10</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-20 12:46:47</date><maj>2008-05-20 12:46:47</maj><valeur>L''ascenseur dispose d''un si&#xE8;ge rabattable (notamment pour les grandes hauteurs d''immeuble)</valeur><valeur>cr_asc_cab_11</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-20 12:46:47</date><maj>2008-05-20 12:46:47</maj><valeur>Pr&#xE9;sence d''un miroir (si l''ascenseur est inf&#xE9;rieur &#xE0; 200 x 140 cm)</valeur><valeur>cr_asc_cab_12</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-20 12:46:47</date><maj>2008-05-20 12:46:47</maj><valeur>Pr&#xE9;sence de dispositifs permettant d''avoir une information relative au mouvement de la cabine</valeur><valeur>cr_asc_cab_13</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-20 12:46:47</date><maj>2008-05-20 12:46:47</maj><valeur>Pr&#xE9;sence d''un indicateur de position de la cabine &#xE0; une hauteur comprise entre 160 et 180 cm</valeur><valeur>cr_asc_cab_14</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-20 12:46:47</date><maj>2008-05-20 12:46:47</maj><valeur>Les num&#xE9;ros d''&#xE9;tages ont une hauteur comprise entre 3 et 6 cm</valeur><valeur>cr_asc_cab_15</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-20 12:46:48</date><maj>2008-05-20 12:46:48</maj><valeur>A l''arr&#xEA;t, un message vocal indique la position de la cabine</valeur><valeur>cr_asc_cab_16</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-20 12:46:48</date><maj>2008-05-20 12:46:48</maj><valeur>Pr&#xE9;sence de dispositifs visuels et sonores permettant d''avoir l''information relative &#xE0; la transmission du syst&#xE8;me d''alarme</valeur><valeur>cr_asc_cab_17</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-20 12:46:48</date><maj>2008-05-20 12:46:48</maj><valeur>Pr&#xE9;sence de dispositifs visuels et sonores permettant d''avoir l''information relative &#xE0; la prise en compte du syst&#xE8;me d''alarme</valeur><valeur>cr_asc_cab_18</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-20 12:46:48</date><maj>2008-05-20 12:46:48</maj><valeur>Il y a une boucle &#xE0; induction magn&#xE9;tique pour la diffusion &#xE0; tous de l''information d''urgence</valeur><valeur>cr_asc_cab_19</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-20 12:46:48</date><maj>2008-05-20 12:46:48</maj><valeur>L''ascenseur est en acc&#xE8;s libre (sans clef ou intervenant ext&#xE9;rieur)</valeur><valeur>cr_asc_cab_20</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-20 12:46:48</date><maj>2008-05-20 12:46:48</maj><valeur>Les signaux sonores sont entre 35 et 65 dB</valeur><valeur>cr_asc_cab_21</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-20 12:46:48</date><maj>2008-05-20 12:46:48</maj><valeur>L''&#xE9;clairage est sup&#xE9;rieur &#xE0; 100 lux</valeur><valeur>cr_asc_cab_22</valeur><valeur>124</valeur></donnee></donnees></article></rubrique>