e de chaque vol&#xE9;e d''une largeur au moins &#xE9;gale au giron</valeur><valeur>cr_voirie_esca_13</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:16:37</date><maj>2008-05-06 10:16:37</maj><valeur>Les mains courantes sont &#xE0; une hauteur comprise entre 80 cm et 100 cm &#xE0; la verticale du nez de marche (sauf si la main courante fait office de garde-corps)</valeur><valeur>cr_voirie_esca_14</valeur><valeur>124</valeur></donnee></donnees></article><article id="1833" idRub="4597">cr_voirie_esca_04 6/05/08 - 10:16:54<date>2008-05-06 10:16:54</date><maj>2008-05-21 10:09:55</maj><auteur>6</auteur><donnees><grille>60</grille><champs><champ>ligne_3</champ><champ>ligne_1</champ><champ>ligne_2</champ><champ>mot_1</champ><champ>texte_1</champ><champ>ligne_4</champ><champ>texte_2</champ><champ>mot_2</champ></champs><donnee><date>2008-05-06 10:16:54</date><maj>2008-05-06 10:16:54</maj><valeur>cr_voirie_esca_04</valeur><valeur>002</valeur><valeur>85</valeur><valeur>141</valeur><valeur>bla</valeur><valeur>opo</valeur><valeur>te</valeur><valeur>2</valeur></donnee></donnees></article></rubrique></rubrique></documents>\n', '2008-05-21 10:15:33'),
