maj><valeur>Si impossibilit&#xE9; technique alors pente inf&#xE9;rieure &#xE0; 8% sur une distance inf&#xE9;rieure ou &#xE9;gale &#xE0; 2 m</valeur><valeur>cr_voirie_chem_11</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Si impossibilit&#xE9; technique alors pente inf&#xE9;rieure &#xE0; 12% sur une distance inf&#xE9;rieure ou &#xE9;gale &#xE0; 50 cm</valeur><valeur>cr_voirie_chem_12</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Si pente sup&#xE9;rieure &#xE0; 4% alors palier de repos en bas</valeur><valeur>cr_voirie_chem_13</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Si pente sup&#xE9;rieure &#xE0; 4% alors palier de repos en haut</valeur><valeur>cr_voirie_chem_14</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Si cheminement pentu continu alors palier de repos tous les 10 m</valeur><valeur>cr_voirie_chem_15</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Si cheminement pentu continu alors pr&#xE9;sence d''un main courante ergonomique et constrat&#xE9;e</valeur><valeur>cr_voirie_chem_16</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Le palier est horizontal</valeur><valeur>cr_voirie_chem_17</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Le palier mesure 120 x 140 cm sans obstacle</valeur><valeur>cr_voirie_chem_18</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Un palier de repos pr&#xE9;sent &#xE0; chaque bifurcation du cheminement</valeur><valeur>cr_voirie_chem_19</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Un palier de repos pr&#xE9;sent &#xE0; chaque bifurcation du cheminement poss&#xE8;de un espace de manoeuvre de 200 cm de diam&#xE8;tre</valeur><valeur>cr_voirie_chem_20</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Si rupture de niveau de plus de 40 cm alors garde-corps le long de la rupture de niveau</valeur><valeur>cr_voirie_chem_21</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Le garde au corps est contrast&#xE9; par rapport &#xE0; l''environnement, plein et continu jusqu''au sol</valeur><valeur>cr_voirie_chem_22</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Un ressaut est inf&#xE9;rieure ou &#xE9;gal &#xE0; 2 cm</valeur><valeur>cr_voirie_chem_23</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:23</date><maj>2008-05-06 10:15:23</maj><valeur>Un ressaut est inf&#xE9;rieur ou &#xE9;gal &#xE0; 4 cm si il est en chanfrein &#xE0; 1/3</valeur><valeur>cr_voirie_chem_24</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:24</date><maj>2008-05-06 10:15:24</maj><valeur>La distance entre 2 ressauts est inf&#xE9;rieure ou &#xE9;gale &#xE0; 250 cm</valeur><valeur>cr_voirie_chem_25</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-06 10:15:24</date><maj>2008-05-06 10:15:24</maj><valeur>Absence de pente &#xE0; ''pas d''&#xE2;ne'' </valeur><valeur>cr_voirie_chem_26</valeur><valeur>124</valeur></donnee></donnees></article><article id="1741" idRub="4510">cr_voirie_chem_04 6/05/08 - 10:15:43<date>2008-05-06 10:15:43</date><maj>2008-05-21 10:25:17</maj><auteur>6</auteur><donnees><grille>60</grille><champs><champ>ligne_3</champ><champ>ligne_1</champ><champ>ligne_2</champ><champ>mot_1</champ><champ>texte_1</champ><champ>ligne_4</champ><champ>texte_2</champ><champ>mot_2</champ></champs><donne