1:13:59</maj><auteur>6</auteur><donnees><grille>60</grille><champs><champ>ligne_3</champ><champ>ligne_1</champ><champ>ligne_2</champ><champ>mot_1</champ><champ>texte_1</champ><champ>ligne_4</champ><champ>texte_2</champ><champ>mot_2</champ></champs><donnee><date>2008-05-06 10:16:54</date><maj>2008-05-06 10:16:54</maj><valeur>cr_voirie_esca_04</valeur><valeur>002</valeur><valeur>85</valeur><valeur>141</valeur><valeur>bla</valeur><valeur>opo</valeur><valeur>te</valeur><valeur>2</valeur></donnee></donnees></article></rubrique></rubrique><rubrique id="4561" idParent="4560" idAdmin="6">Commune Test<motclef>59</motclef><article id="1789" idRub="4561">Commune Test<date>2008-05-14 17:43:27</date><maj>2008-05-14 17:47:39</maj><auteur/><donnees><grille>66</grille><champs><champ>mot_2</champ><champ>ligne_1</champ><champ>mot_1</champ></champs><donnee><date>2008-05-14 17:43:27</date><maj>2008-05-14 17:43:27</maj><valeur/><valeur>Commune Test</valeur><valeur>59</valeur></donnee></donnees></article><rubrique id="4584" idParent="4561" idAdmin="">Etab test<motclef/><article id="1816" idRub="4584">Etab test<date>2008-05-20 12:41:48</date><maj>2008-05-21 11:14:02</maj><auteur>5</auteur><donnees><grille>55</grille><champs><champ>code_postal_1</champ><champ>ligne_2</champ><champ>ligne_3</champ><champ>ligne_4</champ><champ>ligne_5</champ><champ>ligne_6</champ><champ>ligne_7</champ><champ>mot_1</champ><champ>mot_2</champ><champ>mot_3</champ><champ>select_1</champ><champ>select_2</champ><champ>ligne_1</champ></champs><donnee><date>2008-05-20 12:41:48</date><maj>2008-05-20 12:41:48</maj><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur>Etab test</valeur></donnee></donnees></article><rubrique id="4585" idParent="4584" idAdmin="">Bat test<motclef/></rubrique></rubrique></rubrique></documents>\n', '2008-05-21 11:14:48'),
