cas de lavabos ou des guichets d''informations, de vente manuelle et de service qui n&#xE9;cessitent de ''lire, &#xE9;crire, utiliser un clavier'', il est est atteignable et utilisable en position ''assis'' parce qu''il d&#xE9;gage un vide de 70 cm de hauteur</valeur><valeur>cr_dis_com_09</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:45:56</date><maj>2008-05-29 08:45:56</maj><valeur>L''&#xE9;quipement, le mobilier est atteignable en position ''debout''</valeur><valeur>cr_dis_com_10</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:45:57</date><maj>2008-05-29 08:45:57</maj><valeur>L''&#xE9;quipement, le mobilier est utilisable en position ''debout''</valeur><valeur>cr_dis_com_11</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:45:57</date><maj>2008-05-29 08:45:57</maj><valeur>L''&#xE9;quipement, le mobilier qui n&#xE9;cessite ''de voir, d''entendre ou parler'' est situ&#xE9; &#xE0; une hauteur comprise entre 90 et 130 cm</valeur><valeur>cr_dis_com_12</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:45:57</date><maj>2008-05-29 08:45:57</maj><valeur>L''&#xE9;quipement, le mobilier ne cr&#xE9;e pas d''obstacle &#xE0; la personne d&#xE9;ficiente visuelle</valeur><valeur>cr_dis_com_13</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:45:57</date><maj>2008-05-29 08:45:57</maj><valeur>Le dispositif de commande et de service est rep&#xE9;rable par un &#xE9;clairage particulier ou un contraste visuel</valeur><valeur>cr_dis_com_14</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:45:58</date><maj>2008-05-29 08:45:58</maj><valeur>Le dispositif de commande et de service poss&#xE8;de un espace d''usage de 80 &#xD7; 130 cm</valeur><valeur>cr_dis_com_15</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:45:58</date><maj>2008-05-29 08:45:58</maj><valeur>Le dispositif de commande et de service est utilisable en position ''assis''</valeur><valeur>cr_dis_com_16</valeur><valeur>