<valeur>La qualit&#xE9; d''&#xE9;clairage est renforc&#xE9;e pour les dispositifs d''acc&#xE8;s</valeur><valeur>cr_lux_03</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:45:52</date><maj>2008-05-29 08:45:52</maj><valeur>La qualit&#xE9; d''&#xE9;clairage est renforc&#xE9;e pour la signal&#xE9;tique</valeur><valeur>cr_lux_04</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:45:52</date><maj>2008-05-29 08:45:52</maj><valeur>Si l''&#xE9;clairage poss&#xE8;de une temporisation, alors l''extinction est progressive</valeur><valeur>cr_lux_05</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:45:52</date><maj>2008-05-29 08:45:52</maj><valeur>Si dispositif de d&#xE9;tection automatique alors la couverture est totale</valeur><valeur>cr_lux_06</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:45:52</date><maj>2008-05-29 08:45:52</maj><valeur>L''&#xE9;clairage est automatis&#xE9; lors des entr&#xE9;es dans les pi&#xE8;ces, sas, etc (et doit pouvoir &#xEA;tre d&#xE9;bray&#xE9; en cas de besoin).</valeur><valeur>cr_lux_07</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:45:52</date><maj>2008-05-29 08:45:52</maj><valeur>Dans une pi&#xE8;ce l''interrupteur est toujours plac&#xE9; &#xE0; c&#xF4;t&#xE9; de la porte d''entr&#xE9;e</valeur><valeur>cr_lux_08</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:45:53</date><maj>2008-05-29 08:45:53</maj><valeur>Les interrupteurs sont &#xE9;quip&#xE9;s de variateurs</valeur><valeur>cr_lux_09</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:45:53</date><maj>2008-05-29 08:45:53</maj><valeur>La disposition des &#xE9;clairages est con&#xE7;ue comme un guide, une aide &#xE0; l''orientation</valeur><valeur>cr_lux_10</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:45:53</date><maj>2008-05-29 08:45:53</maj><valeur>L''&#xE9;clairage artificiel des espaces int&#xE9;rieurs est &gt;= &#xE0; 100 lux</valeur><valeur>cr_lux_11</valeur><valeur>124</valeur></donnee></donnees></article><article id="1877" idRub="4627">cr_lux_01 29/05/08 - 08:46:42<date>2008-05-29 08:46:42</date><maj>2008-05-29 08:46:42</maj><auteur>6</auteur><donnees><grille>60</grille><champs><champ>fichier_1</champ><champ>ligne_1</champ><champ>ligne_2</champ><champ>ligne_4</champ><champ>mot_1</champ><champ>mot_2</champ><champ>texte_1</champ><champ>texte_2</champ><champ>ligne_3</champ></champs><donnee><date>2008-05-29 08:46:42</date><maj>2008-05-29 08:46:42</maj><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur/><valeur>cr_lux_01</valeur></donnee></donnees></article></rubrique><rubrique id="4629" idParent="4626" idAdmin="">Pentes et ressauts<motclef>46</motclef><article id="1874" idRub="4629">Pentes et ressauts<date>2008-05-29 08:46:00</date><maj>2008-05-29 08:46:00</maj><auteur>6</auteur><donnees><grille>59</grille><champs><champ>ligne_2</champ><champ>ligne_1</champ><champ>mot_1</champ></champs><donnee><date>2008-05-29 08:46:00</date><maj>2008-05-29 08:46:00</maj><valeur>Sur le cheminement le devers est inf&#xE9;rieur &#xE0; 2%</valeur><valeur>cr_pente_01</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:00</date><maj>2008-05-29 08:46:00</maj><valeur>En cheminement courant, il est souhaitable que la valeur du d&#xE9;vers ne d&#xE9;passe pas 1%</valeur><valeur>cr_pente_02</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:00</date><maj>2008-05-29 08:46:00</maj><valeur>Exceptionnellement, pente comprise entre 5 et 8 % sur une longueur maxi de 200 cm (en cas d''impossibilit&#xE9; technique)</valeur><valeur>cr_pente_04</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:01</date><maj>2008-05-29 08:46:01</maj><valeur>Exceptionnellement, pente comprise entre 8 et 10 % sur une longueur maxi de 50 cm (en cas d''impossibilit&#xE9; technique)</valeur><valeur>cr_pente_05</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:01</date><maj>2008-05-29 08:46:01</maj><valeur>Exceptionnellement, la pente peut atteindre 12 % sur une longueur de 50 cm (en cas d''impossibilit&#xE9; technique)</valeur><valeur>cr_pente_06</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:01</date><maj>2008-05-29 08:46:01</maj><valeur>Si pente &gt;= 4%, alors pr&#xE9;sence d''un palier de repos tous les 10 m</valeur><valeur>cr_pente_07</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:01</date><maj>2008-05-29 08:46:01</maj><valeur>Pr&#xE9;sence d''un palier de repos en haut de chaque plan inclin&#xE9; quelle que soit sa longueur</valeur><valeur>cr_pente_08</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:02</date><maj>2008-05-29 08:46:02</maj><valeur>Pr&#xE9;sence d''un palier de repos en bas de chaque plan inclin&#xE9; quelle que soit sa longueur</valeur><valeur>cr_pente_09</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:02</date><maj>2008-05-29 08:46:02</maj><valeur>Pente inf&#xE9;rieure ou &#xE9;gale 5 %</valeur><valeur>cr_pente_03</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:02</date><maj>2008-05-29 08:46:02</maj><valeur>Pr&#xE9;sence d''un palier de repos tous les 10 m d&#xE8;s qu''une pente sup&#xE9;rieure &#xE0; 2% est am&#xE9;nag&#xE9;e sur une longue distance</valeur><valeur>cr_pente_10</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:03</date><maj>2008-05-29 08:46:03</maj><valeur>Pr&#xE9;sence d''un palier de repos &#xE0; chaque changement de direction sup&#xE9;rieurs &#xE0; 45&#xB0; en cas de cheminement en pente</valeur><valeur>cr_pente_11</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:03</date><maj>2008-05-29 08:46:03</maj><valeur>Les paliers de repos sont horizontaux</valeur><valeur>cr_pente_12</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:03</date><maj>2008-05-29 08:46:03</maj><valeur>Paliers de repos horizontaux ont une longueur minimale de 140 cm</valeur><valeur>cr_pente_13</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:03</date><maj>2008-05-29 08:46:03</maj><valeur>Paliers de repos horizontaux et rectangulaires de dimension minimale de 120 cm sur 140 cm</valeur><valeur>cr_pente_14</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:04</date><maj>2008-05-29 08:46:04</maj><valeur>Si un ressaut ne peut pas &#xEA;tre &#xE9;vit&#xE9; alors ce dernier est arrondi ou muni de chanfrein</valeur><valeur>cr_pente_15</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:04</date><maj>2008-05-29 08:46:04</maj><valeur>Le ressaut a une hauteur maximale de 2 cm</valeur><valeur>cr_pente_16</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:04</date><maj>2008-05-29 08:46:04</maj><valeur>Le ressaut peut atteindre 4 cm, lorsqu''il est am&#xE9;nag&#xE9; en chanfrein &#xE0; 1 /3</valeur><valeur>cr_pente_17</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:05</date><maj>2008-05-29 08:46:05</maj><valeur>Marquage des ressauts par un contraste visuel par la couleur ou l''&#xE9;clairage</valeur><valeur>cr_pente_18</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:05</date><maj>2008-05-29 08:46:05</maj><valeur>La distance minimale entre 2 ressauts est de 250 cm</valeur><valeur>cr_pente_19</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:05</date><maj>2008-05-29 08:46:05</maj><valeur>Absence de pentes comportant des ressauts successifs (''pas d''&#xE2;ne'')</valeur><valeur>cr_pente_20</valeur><valeur>124</valeur></donnee></donnees></article></rubrique><rubrique id="4630" idParent="4626" idAdmin="">Signal&#xE9;tique<motclef>49</motclef><article id="1875" idRub="4630">Signal&#xE9;tique<date>2008-05-29 08:46:06</date><maj>2008-05-29 08:46:06</maj><auteur>6</auteur><donnees><grille>59</grille><champs><champ>ligne_2</champ><champ>ligne_1</champ><champ>mot_1</champ></champs><donnee><date>2008-05-29 08:46:06</date><maj>2008-05-29 08:46:06</maj><valeur>Les informations sont regroup&#xE9;es</valeur><valeur>cr_sign_01</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:06</date><maj>2008-05-29 08:46:06</maj><valeur>Le support de l''information est contrast&#xE9;</valeur><valeur>cr_sign_02</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:06</date><maj>2008-05-29 08:46:06</maj><valeur>Le support permet une vision et une lecture en position ''assis''</valeur><valeur>cr_sign_03</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:07</date><maj>2008-05-29 08:46:07</maj><valeur>Le support permet une vision et une lecture en position ''debout''</valeur><valeur>cr_sign_04</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:07</date><maj>2008-05-29 08:46:07</maj><valeur>Le support de l''information ne pr&#xE9;sente pas de reflet ou de contre-jour li&#xE9; &#xE0; sa nature</valeur><valeur>cr_sign_05</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:07</date><maj>2008-05-29 08:46:07</maj><valeur>Le support de l''information ne pr&#xE9;sente pas de reflet ou de contre-jour li&#xE9; &#xE0; sa position</valeur><valeur>cr_sign_06</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:08</date><maj>2008-05-29 08:46:08</maj><valeur>Le support de l''information ne pr&#xE9;sente pas de reflet ou de contre-jour li&#xE9; &#xE0; son orientation</valeur><valeur>cr_sign_07</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:08</date><maj>2008-05-29 08:46:08</maj><valeur>Le support d''information est situ&#xE9; &#xE0; une hauteur inf&#xE9;rieure &#xE0; 220 cm</valeur><valeur>cr_sign_08</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:08</date><maj>2008-05-29 08:46:08</maj><valeur>Si le support d''information est situ&#xE9; &#xE0; une hauteur inf&#xE9;rieure &#xE0; 220 cm, une personne peut s''approcher &#xE0; moins de 1 m&#xE8;tre</valeur><valeur>cr_sign_09</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:08</date><maj>2008-05-29 08:46:08</maj><valeur>Le support d''information est situ&#xE9; &#xE0; une hauteur comprise entre 90 et 130 cm</valeur><valeur>cr_sign_10</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:09</date><maj>2008-05-29 08:46:09</maj><valeur>La forme du support est une information en soi</valeur><valeur>cr_sign_11</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:09</date><maj>2008-05-29 08:46:09</maj><valeur>La signal&#xE9;tique est visible</valeur><valeur>cr_sign_12</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:09</date><maj>2008-05-29 08:46:09</maj><valeur>Les informations sur le support sont-elles fortement contrast&#xE9;es</valeur><valeur>cr_sign_13</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:10</date><maj>2008-05-29 08:46:10</maj><valeur>La hauteur des caract&#xE8;res d''&#xE9;criture est-elle proportionn&#xE9;e aux circonstances (elle d&#xE9;pend notamment de l''importance de l''information d&#xE9;livr&#xE9;e, des dimensions du local et de la distance de lecture de r&#xE9;f&#xE9;rence fix&#xE9;e par le ma&#xEE;tre d''ouvrage en fonction de ces &#xE9;l&#xE9;ments)</valeur><valeur>cr_sign_14</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:10</date><maj>2008-05-29 08:46:10</maj><valeur>Dans la mesure o&#xF9; les informations sur le support sont des &#xE9;l&#xE9;ments de signalisation et d''informations relatifs &#xE0; l''orientation, les caract&#xE8;res &#xE9;crits ont une hauteur &gt; &#xE0; 1,5 cm</valeur><valeur>cr_sign_15</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:10</date><maj>2008-05-29 08:46:10</maj><valeur>Sinon, les caract&#xE8;res &#xE9;crits ont une hauteur &gt; &#xE0; 0,45 cm</valeur><valeur>cr_sign_16</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:10</date><maj>2008-05-29 08:46:10</maj><valeur>Les caract&#xE8;res sont en reliefs</valeur><valeur>cr_sign_17</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:11</date><maj>2008-05-29 08:46:11</maj><valeur>Il existe une version &#xE9;crite en braille des informations</valeur><valeur>cr_sign_18</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:11</date><maj>2008-05-29 08:46:11</maj><valeur>La signal&#xE9;tique est lisible</valeur><valeur>cr_sign_19</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:11</date><maj>2008-05-29 08:46:11</maj><valeur>La signalisation pr&#xE9;sente t-elle des ic&#xF4;nes ou des pictogrammes ?</valeur><valeur>cr_sign_20</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:12</date><maj>2008-05-29 08:46:12</maj><valeur>Les ic&#xF4;nes ou pictogrammes sont-ils normalis&#xE9;s ?</valeur><valeur>cr_sign_21</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:12</date><maj>2008-05-29 08:46:12</maj><valeur>Dans le cas d''une information sonore, le niveau sonore est-il r&#xE9;glable</valeur><valeur>cr_sign_22</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:12</date><maj>2008-05-29 08:46:12</maj><valeur>Dans le cas d''une annonce sonore &#xE0; caract&#xE8;re g&#xE9;n&#xE9;rale, celle-ci est-elle pr&#xE9;c&#xE9;d&#xE9;e par un ''jingle''</valeur><valeur>cr_sign_23</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:12</date><maj>2008-05-29 08:46:12</maj><valeur>La signal&#xE9;tique est compr&#xE9;hensible</valeur><valeur>cr_sign_24</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:13</date><maj>2008-05-29 08:46:13</maj><valeur>Identification des fonctions dans le b&#xE2;timent par un syst&#xE8;me de couleur (exemple : administration en rouge, et renseignements en vert)</valeur><valeur>cr_sign_25</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:13</date><maj>2008-05-29 08:46:13</maj><valeur>Les pi&#xE8;ces sont identifi&#xE9;es avec des &#xE9;tiquettes pr&#xE9;sentant des informations en relief et contrast&#xE9;es toujours plac&#xE9;es au m&#xEA;me endroit (dans un b&#xE2;timent)</valeur><valeur>cr_sign_26</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:13</date><maj>2008-05-29 08:46:13</maj><valeur>S''il existe un point d''affichage instantann&#xE9; toutes les informations sonores y sont report&#xE9;es (visuellement)</valeur><valeur>cr_sign_27</valeur><valeur>124</valeur></donnee></donnees></article></rubrique><rubrique id="4631" idParent="4626" idAdmin="">Sols, murs et plafonds<motclef>50</motclef><article id="1876" idRub="4631">Sols, murs et plafonds<date>2008-05-29 08:46:14</date><maj>2008-05-29 08:46:14</maj><auteur>6</auteur><donnees><grille>59</grille><champs><champ>ligne_2</champ><champ>ligne_1</champ><champ>mot_1</champ></champs><donnee><date>2008-05-29 08:46:14</date><maj>2008-05-29 08:46:14</maj><valeur>Le sol ou le rev&#xEA;tement est non meuble</valeur><valeur>cr_sol_01</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:14</date><maj>2008-05-29 08:46:14</maj><valeur>Le sol ou le rev&#xEA;tement est non glissant</valeur><valeur>cr_sol_02</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:14</date><maj>2008-05-29 08:46:14</maj><valeur>Le sol ou le rev&#xEA;tement est non r&#xE9;fl&#xE9;chissant</valeur><valeur>cr_sol_03</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:15</date><maj>2008-05-29 08:46:15</maj><valeur>Le sol ou le rev&#xEA;tement est sans obstacle &#xE0; la roue</valeur><valeur>cr_sol_04</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:15</date><maj>2008-05-29 08:46:15</maj><valeur>Les trous ou fentes ont un diam&#xE8;tre ou une largeur inf&#xE9;rieure &#xE0; 2 cm</valeur><valeur>cr_sol_05</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:15</date><maj>2008-05-29 08:46:15</maj><valeur>Les &#xE9;ventuelles fentes (grilles, etc...) sont positionn&#xE9;es perpendiculairement au cheminement</valeur><valeur>cr_sol_06</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:16</date><maj>2008-05-29 08:46:16</maj><valeur>Les rev&#xEA;tements de sols ne cr&#xE9;ent pas de g&#xEA;ne visuelle</valeur><valeur>cr_sol_07</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:16</date><maj>2008-05-29 08:46:16</maj><valeur>Les rev&#xEA;tements de sols ne cr&#xE9;ent pas de g&#xEA;ne ou sonore </valeur><valeur>cr_sol_08</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:16</date><maj>2008-05-29 08:46:16</maj><valeur>Les tapis fixes situ&#xE9;s au sol sont durs et sans ressaut &gt;= &#xE0; 2 cm</valeur><valeur>cr_sol_09</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:16</date><maj>2008-05-29 08:46:16</maj><valeur>La largeur minimale de cheminement est de 140 cm, libre de tout obstacle</valeur><valeur>cr_sol_10</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:17</date><maj>2008-05-29 08:46:17</maj><valeur>Lorsqu''un r&#xE9;tr&#xE9;cissement ne peut &#xEA;tre &#xE9;vit&#xE9;, la largeur du cheminement reste &gt; &#xE0; 120 cm</valeur><valeur>cr_sol_11</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:17</date><maj>2008-05-29 08:46:17</maj><valeur>Dans la mesure o&#xF9; il existe un obstacle suspendu, il doit laisser un passage libre de 220 cm de haut (200 cm dans les parkings souterrains)</valeur><valeur>cr_sol_12</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:17</date><maj>2008-05-29 08:46:17</maj><valeur>Dans la mesure o&#xF9; il existe un obstacle sur le cheminement ou en saillie de plus de 15 cm sur le cheminement, il est visuellement contrast&#xE9;s par rapport &#xE0; l''environnement imm&#xE9;diat et comporte un rappel tactile ou un prolongement au sol</valeur><valeur>cr_sol_13</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:18</date><maj>2008-05-29 08:46:18</maj><valeur>Tous les obstacles sont visuellement contrast&#xE9;s</valeur><valeur>cr_sol_14</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:18</date><maj>2008-05-29 08:46:18</maj><valeur>Les parois vitr&#xE9;es sur et en bordure de cheminement sont rep&#xE9;rables pour tous &#xE0; l''aide d''&#xE9;l&#xE9;ments visuellement contrast&#xE9;s</valeur><valeur>cr_sol_15</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:18</date><maj>2008-05-29 08:46:18</maj><valeur>Dans les espaces int&#xE9;rieurs de grands volumes o&#xF9; des circulations longues et /ou multiples se pr&#xE9;sentent (halls d''&#xE9;tablissements de grande taille, par exemple ; halls d''exposition, gares de transports collectifs), les dispositions sur le rep&#xE9;rage et le guidage pr&#xE9;vues pour les cheminements ext&#xE9;rieurs s''appliquent.</valeur><valeur>cr_sol_16</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:18</date><maj>2008-05-29 08:46:18</maj><valeur>Pr&#xE9;sence d''une main courante comprise entre 90 et 110 cm de haut le long des murs (et notamment dans les couloirs)</valeur><valeur>cr_sol_17</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:18</date><maj>2008-05-29 08:46:18</maj><valeur>La main courante r&#xE9;pond aux crit&#xE8;res r&#xE9;glementaires de pr&#xE9;hension (diam&#xE8;tre entre 3 et 3,5 cm), de contraste...</valeur><valeur>cr_sol_18</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:19</date><maj>2008-05-29 08:46:19</maj><valeur>La main courante pr&#xE9;sente des informations en relief susceptibles d''orienter les d&#xE9;placements </valeur><valeur>cr_sol_19</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:19</date><maj>2008-05-29 08:46:19</maj><valeur>Pr&#xE9;sence d''un guide tactile et visuellement contrast&#xE9; au sol</valeur><valeur>cr_sol_20</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:19</date><maj>2008-05-29 08:46:19</maj><valeur>Le guide au sol est doubl&#xE9; avec une signal&#xE9;tique en pictogramme</valeur><valeur>cr_sol_21</valeur><valeur>124</valeur></donnee><donnee><date>2008-05-29 08:46:19</date><maj>2008-05-29 08:46:19</maj><valeur>Les zones d''accueil et d''attente du public et salles de restaurations respecte &#xE0; la norme relative &#xE0; l''aire d''absorption (NF EN ISO 11 654)</valeur><valeur>cr_sol_22</valeur><valeur>124</valeur></donnee></donnees></article></rubrique></rubrique></rubrique></rubrique></rubrique></rubrique></rubrique></documents>\n', '2008-05-29 08:48:31'),
